import { Box } from '@mui/material';
import React from 'react';
import './CTAButton.scss';

const CTAButton = ({text, classname}) => {
    return(
        <Box className={`cta-btn ${classname ? classname : ''}`}>
            {text}
        </Box>
    );
};

export default CTAButton;
